import React from "react";

export const ContactForm = ({
  name,
  setName,
  phone,
  setPhone,
  email,
  setEmail,
  handleSubmit
}) => {
  return (
    <>
    <form onSubmit={handleSubmit}>
      <input type="text" name="name" value={name} onCh/>
      <input type="tel" name="phone" pattern="(\+40|0)(2|3|7|6)[0-9]{8}" value={phone}/>
      <input type="email" name="email" value={email}/>
      <input type="submit" name="submit" />
    </form>
    </>
  );
};
